public void execute() {
    FigureEnumeration k = new ReverseFigureEnumerator(fView.selectionZOrdered());
    while (k.hasMoreElements()) {
        fView.drawing().sendToBack(k.nextFigure());
    }
    fView.checkDamage();
}
